<html lang="en">
    <head>
        <link rel="stylesheet" href="https://stackpath.bootstrapcdn.com/bootstrap/4.1.3/css/bootstrap.min.css">
        <script src="https://cdn.plot.ly/plotly-latest.min.js"></script>
        <script src="https://cdn.jsdelivr.net/npm/lodash@4.17.11/lodash.min.js"></script>

    </head>
    <body>
        <div class="container">
            <div class="row" style = "font-family:Special Elite,serif;font-size:20px">
                Select the number of bins
            </div>
            <div class="row">
                <div class="col">
                    <div id="myDiv" style="height: 400px;"></div>
                </div>
            </div>
            <div class="row">
                <div class="col">
                    Number of samples: <span id="nSamplesText"></span>
                </div>
            </div>
            <div class="row">
                <div class="col-3">
                    Number of bins: <span id="histNBinsText"></span>
                </div>
                <div class="col">
                    <input class="custom-range" id="histNBinsSlider", type="range" min="0" max="27" step="1" value="3">
                </div>
            </div>
            <div class="row">
                <div class="col-9">
                    Error: <span id="errorText"></span>
                </div>
                <div class="col-3">
                    <div class="custom-control custom-switch">
                        <input type="checkbox" class="custom-control-input" id="hideHistCheckbox">
                        <label class="custom-control-label" for="hideHistCheckbox">Hide / Show histogram</label>
                    </div>
                </div>
            </div>
        </div>
        <script>
            App = class {
                constructor() {
                    // ## Parameters

                    // ### Plot ranges
                    this.x_min = 0;
                    this.x_max = 50;
                    this.y_min = 0;
                    this.y_max = 0.2;

                    // ### Historgram
                    this.show_hist = true;
                    this.hist_n_samples = 10000
                    this.hist_bins = 10

                    this.hist_data = [];

                    // ### Normal distribution
                    // this.n_grid = 1000;
                    this.norm_grid_step = 0.05;

                    this.norm_mean = 20;
                    this.norm_std = 3;
                    this.norm_grid = [];
                    this.norm_pdf = [];

                    this.plot_layout = {
                        xaxis: {
                            range: [this.x_min, this.x_max]
                        },
                        yaxis: {
                            range: [this.y_min, this.y_max]
                        }
                    };

                    this.plot_data = [{
                        x: [],
                        type: 'histogram',
                        histnorm: 'probability density',
                        name: 'Histogram',
                        autobinx: false
                    }, {
                        // go.Scatter(x=grid, y=calc_pdf(mean=mean, std=std), mode = 'lines', name='Normal distribution'),
                        x: [],
                        y: [],
                        type: 'scatter',
                        name: 'Normal distribution',
                        fill: 'none',
                    }, {
                        // go.Scatter(x=grid, y=calc_pdf(mean=mean, std=std), mode = 'lines', name='Normal distribution'),
                        x: [],
                        y: [],
                        type: 'scatter',
                        name: 'Approximation error',
                        fill: 'tonexty',
                    }];

                }

                init(){
                    this.n_samples_text = document.getElementById('nSamplesText');
                    this.hist_bins_text = document.getElementById('histNBinsText');
                    this.error_text = document.getElementById('errorText');
                    this.hist_bins_slider = document.getElementById('histNBinsSlider');
                    this.hide_hist_checkbox = document.getElementById('hideHistCheckbox');

                    let self = this;
                    this.hist_bins_slider.addEventListener('input', function() { self.update(); });
                    this.hide_hist_checkbox.addEventListener('change', function() { self.update(); });

                    // Generate hist_data
                    this.hist_data = data.slice(0, this.hist_n_samples);
                    this.hist_data.sort((a, b) => a - b);
                    this.hist_count = _.range(this.hist_data.length);
                    // this.hist_data = []
                    // for (var i = 0; i < this.hist_n_samples; i ++) {
                    //     this.hist_data[i] = Math.random() * this.hist_std + this.hist_mean;
                    // }

                    // Generate norm_grid
                    this.norm_grid = [];
                    for (var i = this.x_min; i <= this.x_max; i += this.norm_grid_step) {
                        this.norm_grid.push(i);
                    }
                    this.norm_pdf = []
                    for (var i = 0; i < this.norm_grid.length; i ++) {
                        this.norm_pdf.push(this.calc_pdf(this.norm_grid[i]));
                    }
                
                    this.plot_data[0].x = this.hist_data;
                    this.plot_data[1].x = this.norm_grid;
                    this.plot_data[1].y = this.norm_pdf;
                    this.plot_data[2].x = this.norm_grid;
                    this.plot_data[2].y = [];

                    this.n_samples_text.innerHTML = `${this.hist_n_samples}`;

                    this.update();
                }
            
                // PDF function
                calc_pdf(x){
                    return 1 / Math.sqrt(2 * Math.PI * this.norm_std ** 2) * Math.exp(-Math.pow(x - this.norm_mean, 2) / 2 / Math.pow(this.norm_std, 2));
                }

                toggle_hist(){
                    this.show_hist = !this.show_hist;
                    this.update();
                }

                update(){
                    this.show_hist = this.hide_hist_checkbox.checked;
                    this.hist_bins = Math.pow(10 , Math.floor(this.hist_bins_slider.value / 9)) * (this.hist_bins_slider.value % 9 + 1);
                    let bins_min = this.hist_data[0];
                    let bins_max = this.hist_data[this.hist_n_samples -1];
                    let bins_step = (bins_max - bins_min) / this.hist_bins
                    
                    var bins = [];
                    for (var i = 0; i <= this.hist_bins; i += 1) {
                        bins.push(bins_min + i * bins_step);
                    }

                    var hist_values_cum = everpolate.step(bins, this.hist_data, this.hist_count)
                    var hist_values = [0]
                    bins.unshift(0)
                    for (var i = 0; i < hist_values_cum.length - 1; i += 1) {
                        hist_values.push(hist_values_cum[i + 1] - hist_values_cum[i]);
                    }
                    hist_values.push(0);
                    hist_values = hist_values.map((x) => x / this.hist_n_samples / bins_step);
                    hist_values = everpolate.step(this.norm_grid, bins, hist_values);

                    this.plot_data[2].y = hist_values;

                    var error = 0
                    for (var i = 0; i < hist_values.length; i += 1) {
                        error += Math.abs((hist_values[i] - this.norm_pdf[i]) * this.norm_grid_step);
                    }


                    this.hist_bins_text.innerHTML = `${this.hist_bins}`;
                    this.error_text.innerHTML = `${error.toFixed(3)}`;

                    if (this.show_hist) {
                        this.plot_data[0].x = this.hist_data;
                    } else {
                        this.plot_data[0].x = [];
                    }

                    // this.plot_data[0].nbinsx = this.hist_bins;
                    this.plot_data[0].xbins = {start: bins_min, stop: bins_max, size: bins_step};
                    Plotly.react('myDiv', this.plot_data, this.plot_layout, {responsive: true});
                }
            }
